import React from "react";
import { useParams } from "react-router-dom";

function ListArticles() {
  const dataTables = [
    {
      topic: "Moda",
      description:
        "Tendencias de moda, street style, qué llevar esta temporada. Los diseñadores del momento, las colecciones en tendencia. Entrevistas, consejos y lo último en la moda.",
      backend: "http://zagazine.mx/backend/",
    },
  ];

  let { id } = useParams();

  return (
    <div>
      <h3>ID: {id}</h3>
      <h2>{dataTables[0]}</h2>
    </div>
  );
}

export default ListArticles;
